<?php
/**
 * Based on ConvertCharset class by Mikolaj Jedrzejak <mikolajj@op.pl>
 * Good: many times faster than the original, doesn't depend on external files
 * Bad:  charset tables need to be specially prepared, doesn't support
 *       converting directly between charsets other than UTF-8
**/

class Charset {

	public static function To($name, $text) {
		$table = self::Get($name);
		$output = $text;
		foreach ($table as $utf => $xxx) {
			$output = str_replace($utf, $xxx, $output);
		}
		return $output;
	}

	public static function From($name, $text) {
		$table = array_flip(self::Get($name));
		$output = '';
		for ($i = 0; $i < strlen($text); $i++) {
			$char = $text[$i];
			$output .= isset($table[$char])? $table[$char]: $char;
		}
		return $output;
	}

	private static function Get($name) {
		$define = 'CHARSET_'.strtoupper(str_replace('-', '_', $name));
		assert('defined($define)');
		return unserialize(base64_decode(constant($define)));
	}
}

define('CHARSET_ISO_8859_2', '');
 
define('CHARSET_WINDOWS_1250', '');
 
define('CHARSET_CP852', '');
 
define('CHARSET_MAZOVIA', '');
